    %thetaR = thetaR + omegaR*dt;
    
    xdot = R*(omegaR+omegaL)*cos(theta)/2;
    ydot = R*(omegaR+omegaL)*sin(theta)/2;
    omega = R*(omegaR-omegaL)/w;
    
    x = x + xdot*dt;
    y = y + ydot*dt;
    theta = theta + omega*dt;
    
    pos(1,i) = x;
    pos(2,i) = y;
    
